import React from "react";
import "./UserProfile.css";
import logout from "../../store/session";

const UserProfile = (user) => {
const logout = e => {
    e.preventDefault();
    dispatchEvent(sessionActions.logout());
};

    return (
        <>
        <h1>My Account</h1>
        <p>Hello, {user.name}</p>
        <button onClick={logout}>Logout</button>
        <h2>Order History</h2>
        </>
    )
}

export default UserProfile;
